  `location` varchar(200) DEFAULT NULL COMMENT 'Venue name',
  `status` varchar(20) DEFAULT 'Not Started' COMMENT 'Not Started, In Progress, Completed, Voided',
  `max_sets` int(11) NOT NULL DEFAULT 4 COMMENT 'Best of 4 (first to 5 set points wins)',
  `shoot_off` tinyint(1) DEFAULT 0 COMMENT 'Whether match went to shoot-off',
  `shoot_off_winner` tinyint(4) DEFAULT NULL COMMENT '1 or 2 (team position)',
  `winner_team_id` char(36) DEFAULT NULL COMMENT 'Reference to winning team',
  `locked` tinyint(1) DEFAULT 0 COMMENT 'Match locked after verification',
  `card_status` varchar(16) NOT NULL DEFAULT 'PENDING' COMMENT 'PENDING, VER, VOID',
  `verified_at` timestamp NULL DEFAULT NULL COMMENT 'When verified by coach',
  `verified_by` varchar(100) DEFAULT NULL COMMENT 'Who verified (coach ID)',
  `notes` text DEFAULT NULL COMMENT 'Match notes / void reason',
  `lock_history` text DEFAULT NULL COMMENT 'JSON array of lock/unlock/void events',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE current_timestamp(),
  `match_code` varchar(20) DEFAULT NULL COMMENT 'Unique access code for this match (format: team-INITIALS-MMDD)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `match_code` (`match_code`),
  KEY `idx_team_event` (`event_id`),
  KEY `idx_team_date` (`date`),
  KEY `idx_team_status` (`status`),
  KEY `idx_team_locked` (`locked`),
  KEY `idx_team_complete` (`status`,`date`),
  KEY `idx_team_event_status` (`event_id`,`status`),
  KEY `idx_team_match_code` (`match_code`),
  KEY `idx_bracket` (`bracket_id`),
  KEY `idx_bracket_match` (`bracket_match_id`),
  CONSTRAINT `fk_team_event` FOREIGN KEY (`event_id`) REFERENCES `events` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

